window.onload=()=>{var upload_toggle=(t)=>{uploading=!t;btn_upload_img.setAttribute('src',t?'data:image/png;base64,':'data:image/png;base64,')};var btn_upload=document.createElement('button');btn_upload.setAttribute('type','button');btn_upload.setAttribute('name','score_upload');var btn_upload_img=document.createElement('img');btn_upload_img.setAttribute('class','w_120 m_t_5');btn_upload_img.setAttribute('style','margin-bottom: -10px;');upload_toggle(!0);btn_upload.appendChild(btn_upload_img);document.getElementsByClassName('title')[0].parentNode.append(btn_upload);var uploading=!1;btn_upload.onclick=()=>{if(!uploading){upload_toggle(!1);var user=window.prompt('账号名');if(check(0,user))return;var pwd=window.prompt('密码');if(check(1,pwd))return;$.ajax({url:'https://www.diving-fish.com/api/pageparser/page',type:'POST',data:`<login><u>${user}</u><p>${pwd}</p></login>${document.documentElement.outerHTML}`,contentType:'text/plain',success:()=>{window.alert('传分完毕!');upload_toggle(!0);},error:()=>{window.alert('登录失败!可能是密码错了?');upload_toggle(!0);}});};};var check=(t,p)=>{if(!p){window.alert('请输入正确的'+(t?'密码':'账号名'));upload_toggle(!0);return true;};return false;}}